import React from "react";
import {useDispatch, useSelector} from 'react-redux'
import {testHandler} from '../store/actions/actionsIndex'
import styled, {css} from 'styled-components'

const mixin = (height = width, width = height) => {
  return css`
    height: ${height}rem;
    width: ${width}rem;
  `
}

const Button = styled.button`
  ${mixin(10, 10)};
  background-color: red;
`


const App = (props) => {
  return (
    <div>
      <Button>Testing</Button>
    </div>
  );
};



export default App;
